(15, 8, 1, 'Shipment', '<p>1</p>'),
(16, 8, 2, 'الشحن ', '<blockquote type=\"cite\" style=\"color: rgb(33, 33, 33);\"><div id=\"x_divtagdefaultwrapper\" dir=\"rtl\"><p dir=\"RTL\" style=\"margin-bottom: 10px; padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: small;\">كم يستغرق الشحن ليصل الى منزلي ؟</span><br></p></div></blockquote><blockquote type=\"cite\" style=\"color: rgb(33, 33, 33);\"><div id=\"x_divtagdefaultwrapper\" dir=\"rtl\"><p dir=\"RTL\" style=\"padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: small;\">بعد تاكيد وسيلة الدفع التي قمت باختيارها ، سنقوم بارسال طلبك&nbsp;</span><span style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: small;\">في أغلب الأحيان تستغرق&nbsp;مدة الشحن من 3 الى 5 أيام عمل لجميع انحاء المملكة .&nbsp;</span></p><p dir=\"RTL\" style=\"padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: small;\"><br></span></p><p dir=\"RTL\" style=\"padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: small;\">ماهي المدن التي يتم الشحن لها ؟</span></p><p dir=\"RTL\" style=\"padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: small;\">نقوم بالشحن الى جميع مدن المملكة &nbsp;العربية السعودية .</span></p><p dir=\"RTL\" style=\"padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: small;\"><br></span></p><p dir=\"RTL\" style=\"padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: small;\">كيف يتم شحن الطلب ؟</span></p><p dir=\"RTL\" style=\"padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: small;\">لدينا فريق عمل يقوم بتغليف الطلبات بعناية فائقه ويهتم في ادق التفاصيل وذلك لضمان استلام طلبكم بامان&nbsp;</span></p><p dir=\"RTL\" style=\"padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: small;\"><br></span></p><p dir=\"RTL\" style=\"padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: small;\">ماذا يحدث اذا لم اكن موجود في موعد الاستلام ؟</span></p><p dir=\"RTL\" style=\"padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: small;\">سيقوم موظف شركة الشحن بالاتصال عدة مرات لتسليم الشحنة ، في حال عدم القدرة على الوصول اليك ستتلقى رسالة توضح لك كيفية الحصول على شحنتك .</span></p><p dir=\"RTL\" style=\"margin-bottom: 10px; padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: small;\"><br></span></p></div></blockquote>'),
