(18, 9, 2, 'الدفع', '<blockquote type=\"cite\" style=\"color: rgb(33, 33, 33);\"><div id=\"x_divtagdefaultwrapper\" dir=\"rtl\"><p dir=\"RTL\" style=\"margin-bottom: 10px; padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: small;\">ماهي وسائل الدفع المتاحة&nbsp; ؟</span></p><p dir=\"RTL\" style=\"margin-bottom: 10px; padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: small;\">لدينا عدة وسائل للدفع</span></p><ul><li style=\"margin-bottom: 10px; padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: small;\">البطاقات الائتمانية .</span></li><li style=\"margin-bottom: 10px; padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: small;\">خدمة سداد .</span></li><li style=\"margin-bottom: 10px; padding: 0px; border: 0px; line-height: inherit; vertical-align: top; color: rgb(136, 136, 136); text-align: right;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: small;\">الدفع عند الاستلام .</span></li></ul></div></blockquote>');
