INSERT INTO `templates_translation` (`template_id`, `name`, `template`, `email_template`, `email_title`, `sms_template`, `lang_id`) VALUES
(3, 'Welcome User', 'temp3', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>{site_name} </title>\r\n</head>\r\n\r\n<body dir=\"ltr\">\r\n\r\n<div style=\"overflow: hidden; height: auto; width: 100%; margin: 20px auto; display: block\">\r\n	<header style=\"overflow:hidden;height:auto;width:100%; display:block; padding:20px 0; background:#434048; text-align:center;\">\r\n    	<img src=\"{logo_path}\" alt=\"\"/>    \r\n    </header>\r\n    <aside style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #eee; padding: 10px 11px;\" >\r\n   	    <div style=\"overflow: hidden; height: auto; width: 100%; display: block;\" >\r\n            <h1 style=\"color: #333; font-size: 22px; font-family: Tahoma, Geneva, sans-serif; line-height: 1.7;\" >\r\n                Welcome<span style=\"color:#03C; padding:0px 20px;\" >{username}</span>In {site_name} \r\n             \r\n            </h1>\r\n        </div><!--row-->\r\n    </aside>\r\n    <footer style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #434048; padding: 10px; text-align: center;\">\r\n    	<span style=\"color: #fff; font-size: 14px; font-family: Tahoma, Geneva, sans-serif;\">all rights reserved {site_name} &copy; {year}</span>\r\n    </footer>\r\n</div><!--wrapper-->\r\n\r\n</body>\r\n</html>', '{site_name} / Welcome', 'Dear: {username} Thank you for installing  Our App , but we apologize for the inconvenience, Our App is still under development', 1),
(3, 'ترحيب بالأعضاء الجدد', 'temp3', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>{site_name}</title>\r\n</head>\r\n\r\n<body style=\"direction:rtl\">\r\n\r\n<div style=\"overflow: hidden; height: auto; width: 100%; margin: 20px auto; display: block\">\r\n	<header style=\"overflow:hidden;height:auto;width:100%; display:block; padding:20px 0; background:#434048; text-align:center;\">\r\n    	<img src=\"{logo_path}\" alt=\"\"/>    \r\n    </header>\r\n    <aside style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #eee; padding: 10px 11px;\" >\r\n   	    <div style=\"overflow: hidden; height: auto; width: 100%; display: block;\" >\r\n            <h1 style=\"color: #333; font-size: 22px; font-family: Tahoma, Geneva, sans-serif; line-height: 1.7;\" >مرحبا بك <span style=\"color:#03C; padding:0px 20px;\" >{username}</span> في {site_name} \r\n            </h1>\r\n            \r\n        </div><!--row-->\r\n    </aside>\r\n    <footer style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #434048; padding: 10px; text-align: center;\">\r\n    	<span style=\"color: #fff; font-size: 14px; font-family: Tahoma, Geneva, sans-serif;\">جميع الحقوق محفوظة لموقع {site_name} &copy; {year}</span>\r\n    </footer>\r\n</div><!--wrapper-->\r\n\r\n</body>\r\n</html>', 'مرحبا بك فى {site_name}', 'عزيزى :   {username}شكرا لتثبيت التطبيق لدينا، ولكن نحن نعتذر عن أي إزعاج، لدينا التطبيق لا يزال قيد التطوير', 2),
(4, 'Add Wholesaler', 'new user registered', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>{site_name}</title>\r\n</head>\r\n\r\n<body> \r\n\r\n<div style=\"overflow: hidden; height: auto; width: 100%; margin: 20px auto; display: block\">\r\n	<header style=\"overflow:hidden;height:auto;width:100%; display:block; padding:20px 0; background:#434048; text-align:center;\">\r\n    	<img src=\"{logo_path}\" alt=\"\"/>    \r\n    </header>\r\n    <aside style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #eee; padding: 10px 11px;\" >\r\n   	    <div style=\"overflow: hidden; height: auto; width: 100%; display: block;\" >\r\n            <p style=\"color:#333; font-size:14px; font-family:Tahoma, Geneva, sans-serif; line-height:1.5;\" >Mr/Mrs:  {username}  you are a wholesale now </p>\r\n            <p style=\"color:#333; font-size:14px; font-family:Tahoma, Geneva, sans-serif; line-height:1.5;\" >please follow <a href=\"{wholesaler_link}\">This link </a>to update your data </p>\r\n        </div><!--row-->\r\n    </aside>\r\n    <footer style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #434048; padding: 10px; text-align: center;\">\r\n    	<span style=\"color: #fff; font-size: 14px; font-family: Tahoma, Geneva, sans-serif;\">all rights reserved {site_name} &copy; {year}</span>\r\n    </footer>\r\n</div><!--wrapper-->\r\n\r\n</body>\r\n</html>', 'You are a Wholesaler in {site_name} NOW', 'Dear :  {username}  you are a wholesaler in {site_name} now', 1),
(4, 'إضافة تاجر جملة', 'اضافة مستخدم جديد', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>{site_name}</title>\r\n</head>\r\n\r\n<body style=\"direction:rtl\">\r\n\r\n<div style=\"overflow: hidden; height: auto; width: 100%; margin: 20px auto; display: block\">\r\n	<header style=\"overflow:hidden;height:auto;width:100%; display:block; padding:20px 0; background:#434048; text-align:center;\">\r\n    	<img src=\"{logo_path}\" alt=\"\"/>    \r\n    </header>\r\n    <aside style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #eee; padding: 10px 11px;\" >\r\n   	    <div style=\"overflow: hidden; height: auto; width: 100%; display: block;\" >\r\n            \r\n            <p style=\"color:#333; font-size:14px; font-family:Tahoma, Geneva, sans-serif; line-height:1.5;\" >عزيزى :   {username} تم تحويلك لتاجر جملة</p>\r\n            <p style=\"color:#333; font-size:14px; font-family:Tahoma, Geneva, sans-serif; line-height:1.5;\" >برجاء <a href=\"{wholesaler_link}\">الضغط هنا </a> لتغير بياناتك</p>\r\n            \r\n        </div><!--row-->\r\n    </aside>\r\n    <footer style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #434048; padding: 10px; text-align: center;\">\r\n    	<span style=\"color: #fff; font-size: 14px; font-family: Tahoma, Geneva, sans-serif;\">جميع الحقوق محفوظة لموقع {site_name}&copy; {year}</span>\r\n    </footer>\r\n</div><!--wrapper-->\r\n\r\n</body>\r\n</html>', 'اصبحت تاجر فى {site_name}', 'عزيزى :   {username} تم تحويلك لتاجر جملة لموقع {site_name}', 2),
(5, 'accept order', 'product :{product_name} with Serials {serials}  are sent to user {username}', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>{site_name}</title>\r\n</head>\r\n\r\n<body style=\"border-top:5px solid #fff; padding:0; direction:rtl;margin:0;font-family:tahoma ;direction: ltr;\">\r\n\r\n<div style=\"width:600px; display:block;margin:50px auto 0; overflow:hidden; border:2px solid #fff;\">\r\n	<header style=\"background:#225fad; display:block; width:100%; overflow:hidden; height:auto;\">\r\n    	<div style=\"overflow:hidden; height:auto; width:45%;float:right;padding:20px 2%; text-align:center; border-right:1px solid rgba(255,255,255,.3)\">\r\n        	<img src=\"{logo_path}\" alt=\"logo\"/>\r\n        </div><!--logo-->\r\n        <div style=\"overflow: hidden; height: auto; width: 46%; float: left; text-align: left; padding: 2%; font-size: 14px; color: #fff;\">\r\n        	<span>Welcome ..</span><br/>\r\n            <span>Thanks for ordering from {site_name}</span><br/>\r\n            <span>Your order has been approved</span>\r\n        </div><!---->\r\n    </header>\r\n    <main style=\"overflow:hidden; height:auto; width:96%; display:block; padding:20px 2%; background:#fff;\">\r\n    	<h2 style=\"color:#000; line-height:1; text-align:center;\"> <span>Order number </span> <span style=\"font-family:tahoma\"># {order_id} </span></h2>\r\n        <p style=\"color:#000; font-size:14px; text-align:center;\"><span>Order date</span> <span style=\"font-family:tahoma\">{order_time}</span> <span style=\"font-family:tahoma\"></span></p>	\r\n        \r\n        <div style=\"background:#e1f0f8; padding:3px 2%; color:#353434; font-size:14px; width:96%; display:block;\">\r\n        	<span>Order details</span>\r\n        </div><!---->\r\n        <div style=\" width:100%; display:block; overflow:hidden; height:auto; border-bottom:1px dotted #000;font-size:14px; line-height:2; padding:5px 0\">\r\n	        <div style=\"width:50%; float:right; overflow:hidden; height:auto; \">\r\n            	<span>Name : </span>\r\n                <span>  {username} </span>\r\n            </div><!---->\r\n            <div style=\"width:50%; float:right; overflow:hidden; height:auto;\">\r\n            	<span>Email :</span>\r\n                <span>  {user_email} </span>\r\n                <span></span>\r\n            </div><!---->\r\n        </div><!--row-->\r\n        <div style=\" width:100%; display:block; overflow:hidden; height:auto;font-size:14px; line-height:2; padding:5px 0\">\r\n	        <div style=\"width:50%; float:right; overflow:hidden; height:auto; \">\r\n            	<span>Payment method :</span>\r\n                <span>  {payment_method} </span>\r\n            </div><!---->\r\n            <div style=\"width:50%; float:right; overflow:hidden; height:auto;\">\r\n            	<span>Phone number :</span>\r\n                <span> {user_phone} </span>\r\n            </div><!---->\r\n        </div><!--row-->\r\n        <div style=\"width:100%; display:block; overflow:hidden; overflow:hidden;\">\r\n        	<table cellpadding=\"0\" border=\"0\" width=\"100%\" style=\"text-align:center; font-size:14px;\">\r\n            	 {order_details_email} \r\n            </table>\r\n        </div><!--row-->\r\n    </main>\r\n    \r\n</div><!--container-->\r\n<footer style=\" width:600px; margin:5px auto; display:block; height:auto; padding:5px 0; overflow:hidden;\">\r\n    	<div style=\" width:100%; overflow:hidden; height:auto; display:block;\">\r\n        	<div style=\"width:70%; float:left; overflow:hidden; font-size:14px; color:#000000\"><span>Follow us to get our latest offers </span></div>\r\n            <div style=\" width:30%; float:left; overflow:hidden; height:auto\">\r\n          \r\n            </div><!---->\r\n        </div><!--row-->\r\n        <p style=\" color:#225fad; font-size:16px;margin-top:10px; text-align:center\">We are always online on customercare@{site_url} <br/>\r\n        <span style=\"font-family:tahoma\">Thank You, {site_url}</span></p>\r\n    </footer>\r\n\r\n</body>\r\n</html>', '{site_name} / Accept Order', 'your order number {order_id} has been approved\r\n{order_details_sms}', 1),
(5, 'قبول الطلب', 'Serials {serials}  are sent to user {username}', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>{site_name}</title>\r\n</head>\r\n\r\n<body style=\"border-top:5px solid #fff; padding:0; direction:rtl;margin:0;font-family:tahoma\">\r\n\r\n<div style=\"width:600px; display:block;margin:50px auto 0; overflow:hidden; border:2px solid #fff;\">\r\n	<header style=\"background:#225fad; display:block; width:100%; overflow:hidden; height:auto;\">\r\n    	<div style=\"overflow:hidden; height:auto; width:45%;float:left;padding:20px 2%; text-align:center; border-right:1px solid rgba(255,255,255,.3)\">\r\n        	<img src=\"{logo_path}\" alt=\"logo\"/>\r\n        </div><!--logo-->\r\n        <div style=\"overflow:hidden; height:auto; width:46%;float:left;text-align:right;  padding:2%; font-size:16px; color:#fff; font-family:Droid arabic kufi\">\r\n        	<span>مرحبا بكم ..</span><br/>\r\n            <span>شكراً لطلبك من {site_name}</span><br/>\r\n            <span>فاتورة الطلب</span>\r\n        </div><!---->\r\n    </header>\r\n    <main style=\"overflow:hidden; height:auto; width:96%; display:block; padding:20px 2%; background:#fff;\">\r\n    	<h2 style=\"color:#000; line-height:1; text-align:center;\"> <span>رقم طلبك </span> <span style=\"font-family:tahoma\"># {order_id} </span></h2>\r\n        <p style=\"color:#000; font-size:14px; text-align:center;\"><span>تاريخ الطلب</span> <span style=\"font-family:tahoma\">{order_time}</span> <span style=\"font-family:tahoma\"></span></p>	\r\n        \r\n        <div style=\"background:#e1f0f8; padding:3px 2%; color:#353434; font-size:14px; width:96%; display:block;\">\r\n        	<span>تفاصيل الطلب</span>\r\n        </div><!---->\r\n        <div style=\" width:100%; display:block; overflow:hidden; height:auto; border-bottom:1px dotted #000;font-size:14px; line-height:2; padding:5px 0\">\r\n	        <div style=\"width:50%; float:right; overflow:hidden; height:auto; \">\r\n            	<sp