: center;\">\r\n    	<span style=\"color: #fff; font-size: 14px; font-family: Tahoma, Geneva, sans-serif;\">جميع الحقوق محفوظة لموقع {site_name} &copy; {year}</span>\r\n    </footer>\r\n</div><!--wrapper-->\r\n\r\n</body>\r\n</html>', '{site_name} / الرد على الطلب', 'نعتذر عن التأخير فى الرد على طلبك ... سيتم فحص طلبك قريبا', 2),
(23, 'ticket reply', '11', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>{site_name}</title>\r\n</head>\r\n\r\n<body dir=\"rtl\"> \r\n\r\n<div style=\"overflow: hidden; height: auto; width: 100%; margin: 20px auto; display: block\">\r\n	<header style=\"overflow:hidden;height:auto;width:100%; display:block; padding:20px 0; background:#434048; text-align:center;\">\r\n    	<img src=\"{logo_path}\" alt=\"\"/>    \r\n    </header>\r\n    <aside style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #eee; padding: 10px 11px;\" >\r\n   	    <div style=\"overflow: hidden; height: auto; width: 100%; display: block;\" >\r\n            \r\n            <p style=\"color:#333; font-size:14px; font-family:Tahoma, Geneva, sans-serif; line-height:1.5; text-align: center;\" >Dear : {username} your ticket <a href=\"{user_ticket_link}\">Ticket link</a> is replied with {reply_text}</p>\r\n        </div><!--row-->\r\n    </aside>\r\n    <footer style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #434048; padding: 10px; text-align: center;\">\r\n    	<span style=\"color: #fff; font-size: 14px; font-family: Tahoma, Geneva, sans-serif;\">all rights reserved {site_name} &copy; {year}</span>\r\n    </footer>\r\n</div><!--wrapper-->\r\n\r\n</body>\r\n</html>', '{site_name} / Ticket Reply', 'your ticket is replied with :  {reply_text}', 1),
(23, 'الرد على التذكرة', 'يي', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>{site_name}</title>\r\n</head>\r\n\r\n<body dir=\"rtl\"> \r\n\r\n<div style=\"overflow: hidden; height: auto; width: 100%; margin: 20px auto; display: block\">\r\n	<header style=\"overflow:hidden;height:auto;width:100%; display:block; padding:20px 0; background:#434048; text-align:center;\">\r\n    	<img src=\"{logo_path}\" alt=\"\"/>    \r\n    </header>\r\n    <aside style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #eee; padding: 10px 11px;\" >\r\n   	    <div style=\"overflow: hidden; height: auto; width: 100%; display: block;\" >\r\n            \r\n            <p style=\"color:#333; font-size:14px; font-family:Tahoma, Geneva, sans-serif; line-height:1.5; text-align: center;\" >السيد : {username} تذكرتك <a href=\"{user_ticket_link}\">رابط التذكرة</a> تم الرد عليها : {reply_text}</p>\r\n        </div><!--row-->\r\n    </aside>\r\n    <footer style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #434048; padding: 10px; text-align: center;\">\r\n    	<span style=\"color: #fff; font-size: 14px; font-family: Tahoma, Geneva, sans-serif;\">جميع الحقوق محفوظة {site_name} &copy; {year}</span>\r\n    </footer>\r\n</div><!--wrapper-->\r\n\r\n</body>\r\n</html>', '{site_name}/ الرد على التذكرة', 'تم الرد على تذكرتك : {reply_text}', 2),
(25, 'الالغاء التلقائى', 'تم الالغاء التلقائى للطلب رقم {order_id}', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>{site_name}</title>\r\n</head>\r\n\r\n<body style=\"direction:rtl\">\r\n\r\n<div style=\"overflow: hidden; height: auto; width: 100%; margin: 20px auto; display: block\">\r\n	<header style=\"overflow:hidden;height:auto;width:100%; display:block; padding:20px 0; background:#434048; text-align:center;\">\r\n    	<img src=\"{logo_path}\" alt=\"\"/>    \r\n    </header>\r\n    <aside style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #eee; padding: 10px 11px;\" >\r\n   	    <div style=\"overflow: hidden; height: auto; width: 100%; display: block;\" >\r\n            \r\n            <p style=\"color:#333; font-size:14px; font-family:Tahoma, Geneva, sans-serif; line-height:1.5;\" > تم  الإلغاء التلقائى للطلب رقم {order_id}</p>\r\n        </div><!--row-->\r\n        <div style=\"overflow:hidden; height:auto; width:100%; display:block; margin-top:20px; margin-bottom:20px;\" >\r\n        	<table width=\"100%\" border=\"1\" style=\"font-family:Tahoma, Geneva, sans-serif; font-size:15px; line-height:2;\">\r\n            	<tr style=\"text-align:center; font-weight:bold; font-size:16px; background:#009; color: #fff;\" >\r\n                	<td colspan=\"2\">تفاصيل الطلب </td>\r\n                </tr>\r\n                <tr>\r\n                	<td>رقم الطلب :</td>\r\n                    <td> {order_id}</td>\r\n                </tr>\r\n                \r\n            	<tr>\r\n                	<td>مقدم الطلب :</td>\r\n                    <td> {username}</td>\r\n                </tr>\r\n                <tr>\r\n                	<td>تاريخ الطلب :</td>\r\n                    <td>{order_time}</td>\r\n                </tr>\r\n            </table>\r\n        </div><!--row-->\r\n        \r\n        \r\n    </aside>\r\n    <footer style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #434048; padding: 10px; text-align: center;\">\r\n    	<span style=\"color: #fff; font-size: 14px; font-family: Tahoma, Geneva, sans-serif;\">جميع الحقوق محفوظة لموقع {site_name} &copy; {year}</span>\r\n    </footer>\r\n</div><!--wrapper-->\r\n\r\n</body>\r\n</html>', '{site_name}/ الالغاء التلقائى', 'تم الإلغاء التلقائى للطلب رقم {order_id}', 2);
INSERT INTO `templates_translation` (`template_id`, `name`, `template`, `email_template`, `email_title`, `sms_template`, `lang_id`) VALUES
(27, 'incorrect login', 'Incorrect login attempt with email: {email} and password: {password}', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>{site_name} Incorrect login</title>\r\n</head>\r\n\r\n<body style=\"background:#ebebeb; border-top:5px solid #fff; padding:0; direction:ltr;margin:0;font-family:Droid arabic kufi\">\r\n\r\n<div style=\"width:600px; display:block;margin:50px auto 0; overflow:hidden; border:2px solid #fff;\">\r\n	<header style=\"background:#225fad; display:block; width:100%; overflow:hidden; height:auto;\">\r\n    	<div style=\"overflow:hidden; height:auto; width:45%;float:left;padding:20px 2%; text-align:center; border-right:1px solid rgba(255,255,255,.3)\">\r\n        	<img src=\"{logo_path}\" alt=\"logo\"/>\r\n        </div><!--logo-->\r\n        <div style=\"overflow:hidden; height:auto; width:46%;float:left;text-align:center;  padding:2%; font-size:14px; color:#fff; font-family:Droid arabic kufi\">\r\n        	<span>Incorect Login</span><br/>\r\n            \r\n        </div><!---->\r\n    </header>\r\n    <main style=\"overflow:hidden; height:auto; width:96%; display:block; padding:20px 2%; background:#fff;\">\r\n    	\r\n        <div style=\"background:#e1f0f8; padding:3px 2%; color:#353434; font-size:14px; width:96%; display:block;text-align: center;\">\r\n        	<span>Details</span>\r\n        </div><!---->\r\n        <div style=\" width:100%; display:block; overflow:hidden; height:auto; border-bottom:1px dotted #000;font-size:14px; line-height:2; padding:5px 0;text-align: center;\">\r\n	        <div style=\"width:50%; float:right; overflow:hidden; height:auto; \">\r\n            	<span>Email: </span>\r\n                <span> {email}</span>\r\n            </div><!---->\r\n            <div style=\"width:50%; float:right; overflow:hidden; height:auto;\">\r\n            	<span>Password :</span>\r\n                <span>{password}</span>\r\n            </div><!---->\r\n        </div><!--row-->\r\n        <div style=\" width:100%; display:block; overflow:hidden; height:auto;font-size:14px; line-height:2; padding:5px 0; border-bottom:1px dotted #000;direction:ltr; text-align: center;\">\r\n	        <div style=\"width:50%; float:right; overflow:hidden; height:auto; \">\r\n            	<span>Agent :</span>\r\n                <span>  {agent}</span>\r\n            </div><!---->\r\n            <div style=\"width:50%; float:right; overflow:hidden; height:auto;\">\r\n            	<span>ip address :</span>\r\n                <span>{ip_address}</span>\r\n            </div><!---->\r\n        </div><!--row-->\r\n        <div style=\" width:100%; display:block; overflow:hidden; height:auto;font-size:14px; line-height:2; padding:5px 0;text-align: center;\">\r\n	        <div style=\"width:50%; float:right; overflow:hidden; height:auto; \">\r\n            	<span>Date :</span>\r\n                <span>  {unix_time}</span>\r\n            </div><!---->\r\n            \r\n        </div><!--row-->\r\n        \r\n    </main>\r\n    \r\n</div><!--container-->\r\n<footer style=\" width:600px; margin:5px auto; display:block; height:auto; padding:5px 0; overflow:hidden;\">\r\n        <p style=\" color:#225fad; font-size:16px;margin-top:10px; text-align:center\"><br/>\r\n        <span style=\"font-family:tahoma\">Thank You, {site_url}</span></p>\r\n    </footer>\r\n\r\n</body>\r\n</html>', '{site_name}/incorrect login', 'Incorrect login attempt with email: {email} and password: {password}', 1),
(27, 'محاولة دخول خاطىء', 'محاولة دخول خاطىء بايميل : {email} و كلمة مرور : {password}', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>Incorrect login</title>\r\n</head>\r\n\r\n<body style=\"background:#ebebeb; border-top:5px solid #fff; padding:0; direction:rtl;margin:0;font-family:Droid arabic kufi\">\r\n\r\n<div style=\"width:600px; display:block;margin:50px auto 0; overflow:hidden; border:2px solid #fff;\">\r\n	<header style=\"background:#225fad; display:block; width:100%; overflow:hidden; height:auto;\">\r\n    	<div style=\"overflow:hidden; height:auto; width:45%;float:left;padding:20px 2%; text-align:center; border-right:1px solid rgba(255,255,255,.3)\">\r\n        	<img src=\"{logo_path}\" alt=\"logo\"/>\r\n        </div><!--logo-->\r\n        <div style=\"overflow:hidden; height:auto; width:46%;float:left;text-align:center;  padding:2%; font-size:14px; color:#fff; font-family:Droid arabic kufi\">\r\n        	<span>محاولة دخول خاطئة</span><br/>\r\n            \r\n        </div><!---->\r\n    </header>\r\n    <main style=\"overflow:hidden; height:auto; width:96%; display:block; padding:20px 2%; background:#fff;\">\r\n    	\r\n        <div style=\"background:#e1f0f8; padding:3px 2%; color:#353434; font-size:14px; width:96%; display:block;text-align: center;\">\r\n        	<span>تفاصيل الدخول</span>\r\n        </div><!---->\r\n        <div style=\" width:100%; display:block; overflow:hidden; height:auto; border-bottom:1px dotted #000;font-size:14px; line-height:2; padding:5px 0;text-align: center;\">\r\n	        <div style=\"width:50%; float:right; overflow:hidden; height:auto; \">\r\n            	<span>البريد الالكترونى: </span>\r\n                <span> {email}</span>\r\n            </div><!---->\r\n            <div style=\"width:50%; float:right; overflow:hidden; height:auto;\">\r\n            	<span>كلمة المرور :</span>\r\n                <span>{password}</span>\r\n            </div><!---->\r\n        </div><!--row-->\r\n        <div style=\" width:100%; display:block; overflow:hidden; height:auto;font-size:14px; line-height:2; padding:5px 0; border-bottom:1px dotted #000;direction:ltr; text-align: center;\">\r\n	        <div style=\"width:50%; float:right; overflow:hidden; height:auto; \">\r\n            	<span>Agent :</span>\r\n                <span>  {agent}</span>\r\n            </div><!---->\r\n            <div style=\"width:50%; float:right; overflow:hidden; height:auto;\">\r\n            	<span>ip address :</span>\r\n                <span>{ip_address}</span>\r\n            </div><!---->\r\n        </div><!--row-->\r\n        <div style=\" width:100%; display:block; overflow:hidden; height:auto;font-size:14px; line-height:2; padding:5px 0;text-align: center;\">\r\n	        <div style=\"width:50%; float:right; overflow:hidden; height:auto; \">\r\n            	<span>وقت المحاولة  :</span>\r\n                <span>  {unix_time}</span>\r\n            </div><!---->\r\n            \r\n        </div><!--row-->\r\n        \r\n    </main>\r\n    \r\n</div><!--container-->\r\n<footer style=\" width:600px; margin:5px auto; display:block; height:auto; padding:5px 0; overflow:hidden;\">\r\n        <p style=\" color:#225fad; font-size:16px;margin-top:10px; text-align:center\"><br/>\r\n        <span style=\"font-family:tahoma\">Thank You, {site_url}</span></p>\r\n    </footer>\r\n\r\n</body>\r\n</html>', 'محاولة دخول خاطئة {unix_time}', 'محاولة دخول خاطىء', 2),
(28, 'order canceled', '', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>{site_name}</title>\r\n</head>\r\n\r\n<body>\r\n\r\n<div style=\"overflow: hidden; height: auto; width: 100%; margin: 20px auto; display: block\">\r\n	<header style=\"overflow:hidden;height:auto;width:100%; display:block; padding:20px 0; background:#434048; text-align:center;\">\r\n    	<img src=\"{logo_path}\" alt=\"\"/>    \r\n    </header>\r\n    <aside style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #eee; padding: 10px 11px;\" >\r\n   	    <div style=\"overflow: hidden; height: auto; width: 100%; display: block;\" >\r\n            \r\n            <p style=\"color:#333; font-size:14px; font-family:Tahoma, Geneva, sans-serif; line-height:1.5; text-align: center;\" >Dear : {username} Your order number {order_id} was canceled</p>\r\n        </div><!--row-->\r\n    </aside>\r\n    <footer style=\"overflow: hidden; height: auto; width: 100%; display: block; background: #434048; padding: 10px; text-align: center;\">\r\n    	<span style=\"color: #fff; font-size: 14px; font-family: Tahoma, Geneva, sans-serif;\">all rights reserved {site_name}&copy; {year}</span>\r\n    </footer>\r\n</div><!--wrapper-->\r\n\r\n</body>\r\n</html>', '{site_name}/order canceled', 'your order number {order_id } was canceled', 1),
