(32, 'receive order template', '', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>{site_name}</title>\r\n</head>\r\n\r\n<body style=\"border-top:5px solid #fff; padding:0; direction:rtl;margin:0;font-family:tahoma ;direction: ltr;\">\r\n\r\n<div style=\"width:600px; display:block;margin:50px auto 0; overflow:hidden; border:2px solid #fff;\">\r\n	<header style=\"background:#225fad; display:block; width:100%; overflow:hidden; height:auto;\">\r\n    	<div style=\"overflow:hidden; height:auto; width:45%;float:right;padding:20px 2%; text-align:center; border-right:1px solid rgba(255,255,255,.3)\">\r\n        	<img src=\"{logo_path}\" alt=\"logo\"/>\r\n        </div><!--logo-->\r\n        <div style=\"overflow: hidden; height: auto; width: 46%; float: left; text-align: left; padding: 2%; font-size: 14px; color: #fff;\">\r\n        	<span>Welcome ..</span><br/>\r\n            <span>Thanks for ordering from {site_name}</span><br/>\r\n            <span>Your order has been recieved</span>\r\n        </div><!---->\r\n    </header>\r\n    <main style=\"overflow:hidden; height:auto; width:96%; display:block; padding:20px 2%; background:#fff;\">\r\n    	<h2 style=\"color:#000; line-height:1; text-align:center;\"> <span>Order number </span> <span style=\"font-family:tahoma\"># {order_id} </span></h2>\r\n        <p style=\"color:#000; font-size:14px; text-align:center;\"><span>We are preparing your order </span>  </p>	\r\n        <p style=\"color:#000; font-size:14px; text-align:center;\"><span>Order date</span> <span style=\"font-family:tahoma\">{order_time}</span> <span style=\"font-family:tahoma\"></span></p>\r\n        <div style=\"background:#e1f0f8; padding:3px 2%; color:#353434; font-size:14px; width:96%; display:block;\">\r\n        	<span>Order details</span>\r\n        </div><!---->\r\n        <div style=\" width:100%; display:block; overflow:hidden; height:auto; border-bottom:1px dotted #000;font-size:14px; line-height:2; padding:5px 0\">\r\n	        <div style=\"width:50%; float:right; overflow:hidden; height:auto; \">\r\n            	<span>Name : </span>\r\n                <span>  {username} </span>\r\n            </div><!---->\r\n            <div style=\"width:50%; float:right; overflow:hidden; height:auto;\">\r\n            	<span>Email :</span>\r\n                <span>  {user_email} </span>\r\n                <span></span>\r\n            </div><!---->\r\n        </div><!--row-->\r\n        <div style=\" width:100%; display:block; overflow:hidden; height:auto;font-size:14px; line-height:2; padding:5px 0\">\r\n	        <div style=\"width:50%; float:right; overflow:hidden; height:auto; \">\r\n            	<span>Payment method :</span>\r\n                <span>  {payment_method} </span>\r\n            </div><!---->\r\n            <div style=\"width:50%; float:right; overflow:hidden; height:auto;\">\r\n            	<span>Phone number :</span>\r\n                <span> {user_phone} </span>\r\n            </div><!---->\r\n        </div><!--row-->\r\n        \r\n    </main>\r\n    \r\n</div><!--container-->\r\n<footer style=\" width:600px; margin:5px auto; display:block; height:auto; padding:5px 0; overflow:hidden;\">\r\n    	<div style=\" width:100%; overflow:hidden; height:auto; display:block;\">\r\n        	<div style=\"width:70%; float:left; overflow:hidden; font-size:14px; color:#000000\"><span>Follow us to get our latest offers </span></div>\r\n            <div style=\" width:30%; float:left; overflow:hidden; height:auto\">\r\n          \r\n            </div><!---->\r\n        </div><!--row-->\r\n        <p style=\" color:#225fad; font-size:16px;margin-top:10px; text-align:center\">We are always online on customercare@{site_url} <br/>\r\n        <span style=\"font-family:tahoma\">Thank You, {site_url}</span></p>\r\n    </footer>\r\n\r\n</body>\r\n</html>', 'Order received', 'we are preparing your order number', 1),
(32, 'نموذج وصول الطلب', '', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>{site_name}</title>\r\n</head>\r\n\r\n<body style=\"border-top:5px solid #fff; padding:0; direction:rtl;margin:0;font-family:tahoma\">\r\n\r\n<div style=\"width:600px; display:block;margin:50px auto 0; overflow:hidden; border:2px solid #fff;\">\r\n	<header style=\"background:#225fad; display:block; width:100%; overflow:hidden; height:auto;\">\r\n    	<div style=\"overflow:hidden; height:auto; width:45%;float:left;padding:20px 2%; text-align:center; border-right:1px solid rgba(255,255,255,.3)\">\r\n        	<img src=\"{logo_path}\" alt=\"logo\"/>\r\n        </div><!--logo-->\r\n        <div style=\"overflow:hidden; height:auto; width:46%;float:left;text-align:right;  padding:2%; font-size:16px; color:#fff; font-family:Droid arabic kufi\">\r\n        	<span>مرحبا بكم ..</span><br/>\r\n            <span>شكراً لطلبك من {site_name}</span><br/>\r\n            <span>فاتورة الطلب</span>\r\n        </div><!---->\r\n    </header>\r\n    <main style=\"overflow:hidden; height:auto; width:96%; display:block; padding:20px 2%; background:#fff;\">\r\n    	<h2 style=\"color:#000; line-height:1; text-align:center;\"> <span>رقم طلبك </span> <span style=\"font-family:tahoma\"># {order_id} </span></h2>\r\n        <p style=\"color:#000; font-size:14px; text-align:center;\"><span>يتم اعداد طلبك الان</span>  </p>	\r\n        <p style=\"color:#000; font-size:14px; text-align:center;\"><span>تاريخ الطلب</span> <span style=\"font-family:tahoma\">{order_time}</span> <span style=\"font-family:tahoma\"></span></p>\r\n        \r\n        <div style=\"background:#e1f0f8; padding:3px 2%; color:#353434; font-size:14px; width:96%; display:block;\">\r\n        	<span>تفاصيل الطلب</span>\r\n        </div><!---->\r\n        <div style=\" width:100%; display:block; overflow:hidden; height:auto; border-bottom:1px dotted #000;font-size:14px; line-height:2; padding:5px 0\">\r\n	        <div style=\"width:50%; float:right; overflow:hidden; height:auto; \">\r\n            	<span>اسم العميل : </span>\r\n                <span>  {username} </span>\r\n            </div><!---->\r\n            <div style=\"width:50%; float:right; overflow:hidden; height:auto;\">\r\n            	<span>بريدك الإلكتروني :</span>\r\n                <span>  {user_email} </span>\r\n                <span></span>\r\n            </div><!---->\r\n        </div><!--row-->\r\n        <div style=\" width:100%; display:block; overflow:hidden; height:auto;font-size:14px; line-height:2; padding:5px 0\">\r\n	        <div style=\"width:50%; float:right; overflow:hidden; height:auto; \">\r\n            	<span>طريقة الدفع :</span>\r\n                <span>  {payment_method} </span>\r\n            </div><!---->\r\n            <div style=\"width:50%; float:right; overflow:hidden; height:auto;\">\r\n            	<span>رقم الجوال :</span>\r\n                <span> {user_phone} </span>\r\n            </div><!---->\r\n        </div><!--row-->\r\n        <div style=\"width:100%; display:block; overflow:hidden; overflow:hidden;\">\r\n        	\r\n        </div><!--row-->\r\n    </main>\r\n    \r\n</div><!--container-->\r\n<footer style=\" width:600px; margin:5px auto; display:block; height:auto; padding:5px 0; overflow:hidden;\">\r\n    	<div style=\" width:100%; overflow:hidden; height:auto; display:block;\">\r\n        	<div style=\"width:70%; float:right; overflow:hidden; font-size:14px; color:#000000\"><span>تابعونا للحصول على العروض و الخصومات الرائعة من {site_name} </span></div>\r\n            <div style=\" width:30%; float:right; overflow:hidden; height:auto\">\r\n            	\r\n            </div><!---->\r\n        </div><!--row-->\r\n        <p style=\" color:#225fad; font-size:16px;margin-top:10px; text-align:center\">نحن بخدمتكم دائما  <br/>\r\n        <span style=\"font-family:tahoma\">شكرا لك, {site_url}</span></p>\r\n    </footer>\r\n\r\n</body>\r\n</html>', 'تم وصول الطلب', 'يتم اعداد طلبك الان', 2);
